import React from "react";
import { StyleSheet, Text, View } from "react-native";

const SmartScreen = () => {
  return (
    <View style={styles.screen}>
      <Text>The Game Start</Text>
    </View>
  );
};

export default SmartScreen;
const styles = StyleSheet.create({
  screen: {
    flex: 1,
    padding: 10,
    alignItems:"center"
  },
});
